import { useState } from "react";
import Dropdown from "./components/Dropdown";

function App () {
    const [selection, setSelection] = useState(null)

    const hnadleSelect = (option) => {
        setSelection(option)
    }

    const options =  [
        {label: "Red", value: 'red'},
        {label: "Green", value: 'green'},
        {label: "Blue", value: 'blue'}
    ]


    return <Dropdown options={options} selection={selection} onSelect={hnadleSelect} />

}

export default App;
